### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Functions and Their Properties**
- **Function Composition**: Understanding how to compose functions \( f \circ g \) and \( g \circ f \).
- **Domain and Range**: Determining the domain and range of composite functions.
- **One-to-One Functions**: Identifying whether a function is one-to-one (injective).

#### 2. **Differentiability and Continuity**
- **Differentiability**: Understanding the conditions for a function to be differentiable.
- **Continuity**: Ensuring a function is continuous across its domain, especially piecewise functions.
- **Tangent Lines**: Finding the equation of the tangent line to a function at a given point.

#### 3. **Polynomials and Their Derivatives**
- **Polynomial Derivatives**: Calculating the derivative of a polynomial function.
- **Evaluating Derivatives**: Using the derivative to find specific values and relationships between coefficients.

#### 4. **Limits and Sequences**
- **Limit of Sequences**: Calculating the limit of sequences as \( n \) approaches infinity.
- **Behavior of Functions**: Understanding the behavior of functions involving exponentials, polynomials, and trigonometric functions.

#### 5. **Logarithmic and Exponential Functions**
- **Logarithmic Equations**: Solving equations involving logarithms.
- **Exponential Functions**: Understanding the growth and behavior of exponential functions.

### Core Equations

#### Function Composition
- \( f \circ g (x) = f(g(x)) \)
- \( g \circ f (x) = g(f(x)) \)

#### Differentiability and Continuity
- **Derivative of a Polynomial**:
  \[ f'(x) = 5a_5 x^4 + 4a_4 x^3 + 3a_3 x^2 + 2a_2 x + a_1 \]
- **Tangent Line Equation**:
  \[ y = f'(a)(x - a) + f(a) \]

#### Limits
- **Limit of a Rational Function**:
  \[ \lim_{n \to \infty} \frac{n^5 - 3n^3 + \sin(n)}{2n^5 + \ln(n) + n^2} = \frac{1}{2} \]
- **Limit of an Exponential Function**:
  \[ \lim_{n \to \infty} \frac{e^{2n} + n^4}{e^{3n} + n^5} = 0 \]

#### Logarithmic Equations
- **Logarithmic Identity**:
  \[ m^{\log_3 2} + 2^{\log_3 m} = 8 \]

